PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE regime_predictions (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                timestamp DATETIME,
                predicted_regime TEXT,
                confidence REAL,
                actual_regime TEXT,
                market_score REAL,
                indicators TEXT,
                outcome_score REAL,
                feedback_timestamp DATETIME
            , prediction_timeframe TEXT DEFAULT '30M');
CREATE TABLE feature_performance (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                timestamp DATETIME,
                feature_name TEXT,
                regime TEXT,
                importance_score REAL,
                prediction_accuracy REAL,
                update_count INTEGER
            );
CREATE TABLE regime_transitions (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                timestamp DATETIME,
                from_regime TEXT,
                to_regime TEXT,
                transition_indicators TEXT,
                transition_successful BOOLEAN,
                market_impact REAL
            );
CREATE TABLE predictions (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            regime TEXT NOT NULL,
            confidence REAL NOT NULL,
            market_score REAL,
            trend_score REAL,
            momentum_score REAL,
            volatility_score REAL,
            breadth_score REAL,
            scanner_volatility_score REAL,
            scanner_volatility_regime TEXT,
            indicators TEXT,
            reasoning TEXT
        );
CREATE TABLE feedback (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            prediction_id INTEGER,
            timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            actual_regime TEXT,
            user_feedback TEXT,
            performance_score REAL,
            FOREIGN KEY (prediction_id) REFERENCES predictions(id)
        );
CREATE TABLE regime_changes (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            from_regime TEXT,
            to_regime TEXT,
            confidence REAL,
            trigger_indicators TEXT,
            market_conditions TEXT
        );
CREATE TABLE performance_metrics (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            date DATE DEFAULT CURRENT_DATE,
            metric_name TEXT NOT NULL,
            metric_value REAL NOT NULL,
            details TEXT
        );
CREATE TABLE model_parameters (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            parameter_name TEXT NOT NULL,
            parameter_value TEXT NOT NULL,
            parameter_type TEXT,
            description TEXT
        );
DELETE FROM sqlite_sequence;
CREATE INDEX idx_predictions_timestamp 
        ON predictions(timestamp)
        ;
CREATE INDEX idx_predictions_regime 
        ON predictions(regime)
        ;
CREATE INDEX idx_regime_changes_timestamp 
        ON regime_changes(timestamp)
        ;
CREATE INDEX idx_performance_metrics_date 
        ON performance_metrics(date)
        ;
COMMIT;
